#
# @lc app=leetcode id=803 lang=python3
#
# [803] Bricks Falling When Hit
#

# @lc code=start
from typing import List


class Solution:
    def hitBricks(self, grid: List[List[int]], hits: List[List[int]]) -> List[int]:
        stable = self.build_stability(grid)
        print(stable)

        result = []
        for hr, hc in hits:
            if grid[hr][hc] == 1:
                grid[hr][hc] = 0
                new_stable = self.build_stability(grid)
                c = 0
                for i in range(len(stable)):
                    for j in range(len(stable[0])):
                        if stable[i][j] != new_stable[i][j]:
                            grid[i][j] = 0
                            c += 1
                result.append(c - 1)
                stable = new_stable
            else:
                result.append(0)

        return result

    def build_stability(self, grid: List[List[int]]) -> List[List[bool]]:
        stable = [[False for _ in range(len(grid[0]))] for _ in range(len(grid))]
        stable_queue = [(0, j) for j in range(len(grid[0]))]
        while len(stable_queue) > 0:
            i, j = stable_queue.pop(0)
            if grid[i][j] == 1 and not stable[i][j]:
                stable[i][j] = True
                for dr, dc in ((-1, 0), (1, 0), (0, -1), (0, 1)):
                    r = i + dr
                    c = j + dc
                    if r >= 0 and r < len(grid) and c >= 0 and c < len(grid[0]):
                        stable_queue.append((r, c))
        return stable

# @lc code=end

from test_utils import run_test

method = Solution().hitBricks

